import React, { useState } from 'react';

const Contact = () => {
  const [name, setName] = useState('');
  const [message, setMessage] = useState('');
  const [clinic, setClinic] = useState('');
  const [specialist, setSpecialist] = useState('');
  const [preferredDate, setPreferredDate] = useState('');

  const handleNameChange = (e) => {
    setName(e.target.value);
  };

  const handleMessageChange = (e) => {
    setMessage(e.target.value);
  };

  const handleClinicChange = (e) => {
    setClinic(e.target.value);
  };

  const handleSpecialistChange = (e) => {
    setSpecialist(e.target.value);
  };

  const handlePreferredDateChange = (e) => {
    setPreferredDate(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // L贸gica para enviar os dados de agendamento
    console.log('Nome:', name);
    console.log('Mensagem:', message);
    console.log('Unidade de Atendimento Desejada:', clinic);
    console.log('Especialista Desejado:', specialist);
    console.log('Data Preferida:', preferredDate);

    // Limpar os campos ap贸s o envio
    setName('');
    setMessage('');
    setClinic('');
    setSpecialist('');
    setPreferredDate('');
  };

  const labelStyle = {
    display: 'block',
    fontWeight: 'bold',
    marginBottom: '5px',
    color: '#333',
  };

  const inputStyle = {
    width: '100%',
    padding: '10px',
    marginBottom: '15px',
    border: '1px solid #ccc',
    borderRadius: '4px',
  };

  const buttonStyle = {
    padding: '12px 24px',
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '4px',
    fontWeight: 'bold',
    cursor: 'pointer',
    transition: 'background-color 0.3s',
  };

  return (
    <div>
      <h2>Agende sua consulta aqui</h2>
      <p>Entre em contato conosco!</p>

      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="name" style={labelStyle}>
            Nome:
          </label>
          <input
            type="text"
            id="name"
            name="name"
            value={name}
            onChange={handleNameChange}
            style={inputStyle}
          />
        </div>
        <div>
          <label htmlFor="message" style={labelStyle}>
            Mensagem:
          </label>
          <textarea
            id="message"
            name="message"
            rows="4"
            value={message}
            onChange={handleMessageChange}
            style={inputStyle}
          />
        </div>
        <div>
          <label htmlFor="clinic" style={labelStyle}>
            Unidade de Atendimento Desejada:
          </label>
          <input
            type="text"
            id="clinic"
            name="clinic"
            value={clinic}
            onChange={handleClinicChange}
            style={inputStyle}
          />
        </div>
        <div>
          <label htmlFor="specialist" style={labelStyle}>
            Especialista Desejado:
          </label>
          <input
            type="text"
            id="specialist"
            name="specialist"
            value={specialist}
            onChange={handleSpecialistChange}
            style={inputStyle}
          />
        </div>
        <div>
          <label htmlFor="preferredDate" style={labelStyle}>
            Data Preferida:
          </label>
          <input
            type="date"
            id="preferredDate"
            name="preferredDate"
            value={preferredDate}
            onChange={handlePreferredDateChange}
            style={inputStyle}
          />
        </div>
        <button type="submit" style={buttonStyle}>
          Agendar Consulta
        </button>
      </form>
    </div>
  );
};

export default Contact;
